(2145,33,164,3,0,0,'同志们，近日，BSN和公安部联合开展了区块链实名DID的发布活动，要面向13亿人发放面向区块链、web3、元宇宙数字空间的分布式数字身份，did，did和现实公民身份虚实融合，一一映射，用于网络身份登录，网络隐私保护，网络数据确权，关联包括数字人民甚至比特币在内的各种数字资产。未来网络登录，不再需要用户名和密码，不再需要手机验证。我们赶高铁乘飞机住酒店消费购物等，不再需要处处扫脸和出示身份证，不需要透露任何私人信息，只要DID私钥就可以实现自我身份验证，实现自身数据的可用而不可见，实现数据的自我拥有。数据即财富，我们活着就有源源不断的数据，我们的一分一秒，一呼一吸，都在形成数据，每个普通人都有望实现数据财富和数字资产的创造。但发布会也引发行业的广泛热议，行业极端自由主义者，无政府主义者认为，这是政府想在元宇宙中控制我们的身份和我们资产，和世界区块链思维和精神背道而驰。但也有人认为，元宇宙虚实融合，实名与匿名的身份与资产，都很有必要，都会有大市场大空间。在现实中，实名活动和实名资产比例更高，但匿名也存在，也有很多社群是匿名参与的，很多资产是匿名拥有的，比如各种古董，字画，传家宝等等………','四川省德阳市旌阳区钟山街18-15号',3,'2023-12-18 16:30:48',0,2592000,1702891047,1705483047,0),
