insert  into `task`(`id`,`titile`,`content`,`description`,`img_urls`,`reward_mi`,`reward_dou`,`user_id`,`get_number`,`status`,`create_time`,`deadline_time`) values 
(21,'HP20220801期：向火谱伙伴赠送\"斗\",火谱首期','<p>步骤指导：</p><p>1，在火谱小程序，成功创建或加入一个家族</p><p>2，在火谱小程序\"任务\"栏目领取任务</p><p>3，在任务里反馈：创建或加入家族的截图</p><p>4，火谱管理员审批，发放100\"斗\"</p><p><br></p><p>注1：对于有以下行为活动贡献的伙伴增加奖励\"斗\"，最高至500斗：</p><p>1.有在微信朋友圈分享有关火谱信息</p><p>2.有邀请伙伴加入火谱</p><p>3.有在火谱平台发布家族信息</p><p>4.有在其它渠道介绍火谱</p><p>5.有在宣传推广家族家谱文化（不限于火谱）</p><p>有以上行为活动的，请一并上传截图。</p><p><br></p><p>注2：对于前期公告奖励的伙伴，按步骤指导反馈信息即可，无需额外反馈信息</p>','向一路支持火谱的伙伴免费赠予斗，赠送对象：家族家谱文化微信群的群内伙伴，至少赠送100 斗',NULL,0,0,1,40,1,'2022-08-24 11:33:21','2024-04-09 11:31:10');
