  `user_id` int DEFAULT NULL COMMENT '用户id',
  `relation` tinyint(1) DEFAULT '1' COMMENT '和家族关系1直亲2婚姻3表亲',
  `identity` tinyint(1) DEFAULT '0' COMMENT '身份：1：直系，2：婚姻',
