  `audio` longtext COMMENT '音频',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6641 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC COMMENT='家谱图';

